import React, { useContext } from 'react';
import PlanetsContext from '../context/PlanetsContext';

function Selector() {
  const { handleSelect } = useContext(PlanetsContext);
  return (
    <div>
      <select
        className="select"
        id="method"
        data-testid="method-input"
        onChange={ handleSelect }
      >
        <option className="option" value="Dinheiro">Population</option>
        <option className="option" value="Cartão de crédito">Orbital_period</option>
        <option className="option" value="Cartão de débito">Diameter</option>
        <option className="option" value="Cartão de débito">Rotation_period</option>
        <option className="option" value="Cartão de débito">Surface_water</option>
      </select>
    </div>
  );
}

export default Selector;
// population, orbital_period, diameter, rotation_period e surface_water
